import React from "react";


import TopNavBar from "./components/navbar/navbar";
import { Container } from "react-bootstrap";

function App() {
  return (
    <>
      <div className="App">
        <Container fluid>
          <TopNavBar />
        </Container>
      </div>
    </>
  );
}

export default App;
